// src/components/Navbar.js
import React, { useState } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import './Navbar.css';

const Navbar = () => {
  const { user, userRole, logout } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleLogout = () => {
    logout();
    navigate('/login');
    setIsMobileMenuOpen(false);
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  const closeMobileMenu = () => {
    setIsMobileMenu(false);
  };

  // Student Navigation Links
  const studentLinks = [
    { path: '/student', label: 'Dashboard', icon: 'ðŸ“Š' },
    { path: '/student/monitoring', label: 'Monitoring', icon: 'ðŸ‘€' },
    { path: '/student/rating', label: 'Rating', icon: 'â­' }
  ];

  // Lecturer Navigation Links
  const lecturerLinks = [
    { path: '/lecturer', label: 'Dashboard', icon: 'ðŸ“Š' },
    { path: '/lecturer/classes', label: 'My Classes', icon: 'ðŸ«' },
    { path: '/lecturer/reports', label: 'Reports', icon: 'ðŸ“‹' },
    { path: '/lecturer/create-report', label: 'Create Report', icon: 'âœï¸' },
    { path: '/lecturer/monitoring', label: 'Monitoring', icon: 'ðŸ‘€' },
    { path: '/lecturer/rating', label: 'Rating', icon: 'â­' }
  ];

  // Principal Lecturer Navigation Links
  const principalLecturerLinks = [
    { path: '/prl', label: 'Dashboard', icon: 'ðŸ“Š' },
    { path: '/prl/courses', label: 'Courses', icon: 'ðŸ“š' },
    { path: '/prl/reports', label: 'Reports', icon: 'ðŸ“‹' },
    { path: '/prl/monitoring', label: 'Monitoring', icon: 'ðŸ‘€' },
    { path: '/prl/rating', label: 'Rating', icon: 'â­' },
    { path: '/prl/classes', label: 'Classes', icon: 'ðŸ«' }
  ];

  // Program Leader Navigation Links
  const programLeaderLinks = [
    { path: '/pl', label: 'Dashboard', icon: 'ðŸ“Š' },
    { path: '/pl/courses', label: 'Courses', icon: 'ðŸ“š' },
    { path: '/pl/reports', label: 'Reports', icon: 'ðŸ“‹' },
    { path: '/pl/monitoring', label: 'Monitoring', icon: 'ðŸ‘€' },
    { path: '/pl/classes', label: 'Classes', icon: 'ðŸ«' },
    { path: '/pl/lecturers', label: 'Lecturers', icon: 'ðŸ‘¨â€ðŸ«' },
    { path: '/pl/rating', label: 'Rating', icon: 'â­' }
  ];

  // Get navigation links based on user role
  const getNavLinks = () => {
    switch (userRole) {
      case 'student':
        return studentLinks;
      case 'lecturer':
        return lecturerLinks;
      case 'prl':
        return principalLecturerLinks;
      case 'pl':
        return programLeaderLinks;
      default:
        return [];
    }
  };

  // Get user display name and role label
  const getUserDisplayInfo = () => {
    const roleLabels = {
      student: 'Student',
      lecturer: 'Lecturer',
      prl: 'Principal Lecturer',
      pl: 'Program Leader'
    };

    return {
      name: user?.name || user?.email || 'User',
      role: roleLabels[userRole] || 'Unknown Role'
    };
  };

  const { name, role } = getUserDisplayInfo();
  const navLinks = getNavLinks();

  return (
    <nav className="navbar">
      <div className="nav-container">
        {/* Logo/Brand */}
        <Link to="/dashboard" className="nav-logo" onClick={closeMobileMenu}>
          <span className="logo-icon">ðŸŽ“</span>
          LUCT Reporting System
        </Link>

        {/* Mobile Menu Toggle */}
        <div className="nav-toggle" onClick={toggleMobileMenu}>
          <span className="bar"></span>
          <span className="bar"></span>
          <span className="bar"></span>
        </div>

        {/* Navigation Links */}
        <ul className={`nav-menu ${isMobileMenuOpen ? 'nav-menu-active' : ''}`}>
          {navLinks.map((link) => (
            <li key={link.path} className="nav-item">
              <Link
                to={link.path}
                className={`nav-link ${location.pathname === link.path ? 'active' : ''}`}
                onClick={closeMobileMenu}
              >
                <span className="nav-icon">{link.icon}</span>
                {link.label}
              </Link>
            </li>
          ))}
        </ul>

        {/* User Info and Logout */}
        <div className="nav-user-section">
          <div className="user-info">
            <span className="user-name">{name}</span>
            <span className="user-role">{role}</span>
          </div>
          <button 
            className="logout-btn"
            onClick={handleLogout}
            title="Logout"
          >
            <span className="logout-icon">ðŸšª</span>
            Logout
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
